{"query":"query aaveProtocolQuery {
  reserves(where: {liquidityRate_not: "0"}) {
    id
    symbol
    name
    decimals
    underlyingAsset
    liquidityRate
    liquidityIndex
    lastUpdateTimestamp
    price {
      priceInEth
      oracle {
        usdPriceEth
      }
    }
    aToken {
      id
      underlyingAssetAddress
      underlyingAssetDecimals
    }
  }
}
","variables":{},"operationName":"aaveProtocolQuery"}

