{"operationName":"userProtonQuery","variables":{"userAddress":"0x0000000000000000000000000000000000000000","ownedFirst":18,"ownedSkip":0,"createdFirst":18,"createdSkip":0},"query":"query userProtonQuery($userAddress: String!, $ownedFirst: Int!, $ownedSkip: Int!, $createdFirst: Int!, $createdSkip: Int!) {
  ownedProtons: protonNFTs(
    first: $ownedFirst
    skip: $ownedSkip
    where: {owner: $userAddress}
  ) {
    ...userProtonsFragment
    __typename
  }
  createdProtons: protonNFTs(
    first: $createdFirst
    skip: $createdSkip
    where: {creator: $userAddress}
  ) {
    ...userProtonsFragment
    __typename
  }
  protonCounts: protonNftCounts(where: {id: $userAddress}) {
    createdCount
    ownedCount
    __typename
  }
}

fragment userProtonsFragment on ProtonNFT {
  id
  version
  tokenAddress
  tokenId
  owner
  creator
  metadataUri
  particleType
  creatorAnnuity
  salePrice
  lastSalePrice
  resaleRoyalties
  resaleRoyaltiesRedirect
  name
  description
  external_url
  animation_url
  youtube_url
  icon
  image
  thumbnail
  symbol
  decimals
  background_color
  attributes {
    name
    value
    __typename
  }
  __typename
}
"}

